job_detail:
具备扎实的Objective C、C/C++基础；熟悉Iphone平台下GUI设计和实现;
 有一年以上iPhone APP开发经验;
 熟悉HTTP网络协议;
 对数据结构、基本算法熟练掌握，并具备基本的算法设计能力;
 优秀的文档编写和语言表达能力，良好的中英文阅读水平;
 必须具备良好的编程习惯；有较强独立解决问题的能力;
 工作积极主动，有责任心，团队合作意识强，善于沟通与写作，能快速学习并具有较强的领悟能力。

Responsibilities:
 Responsible for technical/system/architecture design and implementation of a feature;
 Implement high quality code with unit testing ensure project on-time delivery; 
 Troubleshoot issues raised from field and resolve customer problems; 
 Peer code review, and provide feedbacks to ensure quality of code;
 Provide technologies or suggestions which improve the team efficiency and platform capability; 
 Techniques and algorithms research. 
Qualifications: 
 Solid C#/.Net development capability;
 Deep understanding on web application development;
 Deep understanding of JavaScript, REST API, WCF, B/S & design patterns;
 Strong problem solving skills and quick learning skills;
 Willing to learn new technologies, such Cloud, IoT, AI, Big Data & etc;
 Able to work independently with other R&D sites with good communication skill;
 8+ years of commercial software development or architecture design experience.
Language:
 Fluent read&written English.

